(4, 'term_condition', '<p>Kami, yang selanjutnya akan disebut sebagai &ldquo;&rdquo; atau &ldquo;kami&rdquo; dan pengguna akan disebut sebagai &ldquo;Pengguna&rdquo; atau &ldquo;Anda&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Syarat dan Ketentuan ini merupakan suatu perjanjian antara  dengan Anda untuk mengatur penggunaan layanan  oleh Anda. Layanan yang dimaksud adalah penyediaan suatu produk, jasa layanan, teknologi atau fungsi lainnya termasuk aplikasi iOS  dan .co.id (<em>website</em>) [semua selanjutnya akan disebut sebagai &ldquo;Layanan&rdquo;].</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<br />\r\n<strong>Kebijakan Privasi</strong><br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\nDengan menyetujui Syarat dan Ketentuan ini, kami asumsikan bahwa Anda telah membaca dan menyetujui juga isi dari Kebijakan Privasi. Kebijakan Privasi dengan Syarat dan Ketentuan merupakan satu kesatuan dokumen yang perlu disetujui oleh pengguna sebelum menggunakan Layanan kami.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<br />\r\n<strong>Informasi Akun</strong><br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\nAnda setuju untuk menyediakan informasi akun yang benar dan akurat, lengkap dengan nama yang benar, alamat, nomor ponsel dan email yang aktif saat melakukan proses pendaftaran akun serta tetap dan segera memperbarui informasi akun untuk memastikan informasi akun benar, lengkap dan terbaru.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<br />\r\n<strong>Kebijakan Penggunaan Akun dan Larangan</strong><br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n berhak menentukan kualifikasi pengguna apakah dapat diterima untuk menggunakan Layanan atau tidak. Dalam segala hal,  dapat melarang, mencegah dan membatalkan akses terhadap Layanan pada setiap waktu, kepada pengguna manapun dengan alasan yang wajar.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pengguna bertanggung jawab sepenuhnya atas penggunaan Layanan dengan sewajarnya. Dan setuju untuk tidak meminta pertanggungjawaban dari  atas segala tuntutan, kerugian dan/atau kehilangan di luar dari penggunaan Layanan.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Anda setuju untuk tidak melakukan hal berikut:</p>\r\n\r\n<ol>\r\n	<li>Melanggar hak privasi orang lain.</li>\r\n	<li>Melanggar hak kekayaan intelektual pihak lain.</li>\r\n	<li>Melakukan hal ilegal seperti pemalsuan identitas, informasi dan lain-lain.</li>\r\n	<li>Suatu penipuan, memperdaya dan menyesatkan pihak lain dengan cara apapun.</li>\r\n	<li>Memanipulasi, merusak atau menghancurkan suatu produk dari .</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Jika ditemukkan adanya pelanggaran, maka pihak  memiliki hak penuh untuk mengakhiri penyediaan Layanan dan penghapusan akun tanpa kewajiban apapun untuk mengembalikan, mengganti atau membayarkan kembali atas segala ganti rugi dalam bentuk apapun. Jika bentuk pelanggaran besar, maka  memiliki hak untuk membuat laporan kepada institusi hukum dan yang berwenang.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<br />\r\n<strong>Tanggung Jawab Kami</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nKami bertanggung jawab penuh atas Layanan yang diberikan kepada Anda, seperti kerusakan produk selama masa garansi, lamanya pelayanan dan pemesanan barang, dan lain-lain. Kami tidak bertanggung jawab atas segala hal yang tidak berhubungan dengan Layanan dan tindakan ilegal yang dilakukan pengguna serta pelanggaran yang dilakukan pengguna baik yang berhubungan dengan Layanan maupun di luar dari Layanan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<br />\r\n<strong>Pembatalan Akun</strong></p>\r\n\r\n<p><br />\r\n<br />\r\nAnda berhak untuk membatalkan atau menghapus akun Anda pada setiap waktu jika telah mendapatkan persetujuan dari pihak kami. Dengan menghapus akun, Anda akan kehilangan&nbsp;<em>rewards</em>&nbsp;yang selama ini Anda kumpulkan dan akan kehilangan informasi mengenai segala proses Layanan yang sedang berlangsung. Anda bertanggung jawab penuh untuk memastikan konten atau data apapun yang Anda perlukan telah disimpan salinan atau cadangannya sebelum dilakukan pembatalan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Apabila akun Anda dibatalkan, maka akun Anda akan dideaktivasi atau dihapus, seluruh hak yang diberikan pada ketentuan layanan ini akan berakhir seketika.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Lain-lain</strong><br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\nUntuk hal lainnya, Anda dapat menghubungi tim kami,</p>'),
(5, 'policy', '<p>Kebijakan Privasi ini berguna untuk melindungi setiap data dan informasi pribadi pengguna www.icolor.co.id dan aplikasi iOS  (yang selanjutnya akan disebut dengan &ldquo;Situs&rdquo;) (Pengguna selanjutnya disebut dengan &ldquo;Anda&rdquo; atau &ldquo;pengguna&rdquo;). Dokumen ini menjelaskan bagaimana PT. Icolor Digital Indonesia menggunakan informasi yang Anda berikan melalui Situs. (selanjutnya akan disebut sebagai &ldquo;&rdquo; atau &ldquo;Kami&rdquo;). Kebijakan privasi ini akan selalu diperbarui oleh Kami.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kebijakan Privasi ini menetapkan atas perolehan, pengumpulan, pengolahan, penganalisisan, dan/atau segala bentuk pengelolaan yang terkait dengan data atau informasi yang pengguna berikan kepada kami atau yang kami kumpulkan dari pengguna, termasuk data pribadi pengguna, baik pada saat pengguna melakukan pendaftaran di Situs, mengakses Situs, maupun mempergunakan layanan-layanan pada Situs (selanjutnya disebut sebagai &quot;data&quot;).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<br />\r\n<strong>Persetujuan Kebijakan</strong><br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\nDengan mengakses dan/atau mempergunakan layanan , pengguna menyatakan bahwa setiap data pengguna merupakan data yang benar dan valid, serta pengguna memberikan persetujuan kepada  untuk memperoleh, mengumpulkan, menyimpan, mengelola dan mempergunakan data tersebut sebagaimana tercantum dalam Kebijakan Privasi maupun Syarat dan Ketentuan Layanan .</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pengguna wajib membaca kebijakan privasi kami dari waktu ke waktu, karena kebijakan ini akan terus diperbarui guna memberikan perlindungan privasi para pengguna. Jika pengguna tidak setuju dengan ketentuan-ketentuan dalam kebijakan ini [Dengan mengirimkan email ke kami], maka disarankan untuk tidak menggunakan layanan dari situs kami.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<br />\r\n<strong>Informasi dan Cara Kami Mengumpulkan Informasi</strong><br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\nKami mengumpulkan, mengelola dan menyimpan informasi pribadi Anda ketika Anda mendaftar akun pada situs  sebagai bagian dari proses verifikasi identitas, transaksi atau interaksi. Adapun data pengguna yang dikumpulkan adalah sebagai berikut:</p>\r\n\r\n<ol>\r\n	<li>Data yang diberikan sendiri oleh pengguna seperti informasi dasar, nama lengkap, alamat email, nomor ponsel dan alamat tempat tinggal.</li>\r\n	<li>Data pada komputer, ponsel atau perangkat lain tempat Anda memasang aplikasi kami atau mengakses Layanan, bergantung pada izin yang Anda berikan.</li>\r\n	<li>Data yang terekam pada saat pengguna mempergunakan situs, seperti data lokasi riil, alamat IP, lokasi Wi-Fi,&nbsp; dan waktu saat melakukan aktivitas <em>login</em>, transaksi dan lainnya.</li>\r\n	<li>Data mengenai perangkat ponsel, seperti tipe ponsel, sistem operasi dan IMEI.</li>\r\n	<li>Setiap informasi yang dikumpulkan oleh <em>cookies</em> dan informasi log umum.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Penggunaan Informasi</strong><br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n dapat menggunakan seluruh atau sebagian data yang diperoleh dan dikumpulkan dari Pengguna untuk hal-hal sebagai berikut:</p>\r\n\r\n<ol>\r\n	<li>Memelihara dan meningkatkan produk dan layanan pada situs kami.</li>\r\n	<li>Mengelola akun Anda, mengumpulkan data dan memproses pembayaran atau transaksi.</li>\r\n	<li>Menginformasikan tentang fitur layanan &amp; produk terbaru, promosi, pembaruan yang ditawarkan oleh kami.</li>\r\n	<li>Memelihara catatan internal.</li>\r\n	<li>Membantu pengguna pada saat berkomunikasi dengan layanan pelanggan .</li>\r\n	<li>Menyelidiki dugaan kecurangan atau pelanggaran terhadap hukum dan aturan apapun.</li>\r\n	<li>Membantu pengecekan jika terjadi kesalahan pada transaksi atau penggunaan layanan .</li>\r\n	<li>Untuk tujuan internal kami seperti audit, analisis data dan penelitian untuk meningkatkan produk, layanan dan komunikasi pelanggan kami.</li>\r\n	<li>Dalam keadaan tertentu,  mungkin perlu untuk menggunakan ataupun mengungkapkan data pengguna untuk tujuan atau sehubungan dengan proses hukum atau diperlukan untuk menetapkan, membela atau melaksanakan hak hukum.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Berbagi Informasi</strong><br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n dapat menjamin tidak ada penjualan, distribusi atau meminjamkan data pribadi Anda kepada pihak lain, tanpa izin dari Anda.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Anda dengan ini setuju bahwa informasi pribadi dapat dibagikan kepada afiliasi, pihak ketiga lain yang membantu  dalam menyajikan layanan pada situs dan memproses segala bentuk aktivitas pengguna dalam situs termasuk memproses.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>transaksi, pengiriman produk dan lain-lain. Selanjutnya  dapat mengungkapkan data pengguna dalam upaya mematuhi kewajiban hukum dan/atau adanya permintaan yang sah dari aparat penegak hukum.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<br />\r\n<strong>Keamanan Informasi dan Kerahasiaan Akun</strong><br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\nAnda harus bertanggung jawab untuk menjaga kerahasiaan akun dan kata sandi Anda sendiri. Anda setuju untuk segera memberitahu kami tentang penggunaan atau pengungkapan yang tidak sah atas akun atau kata sandi Anda, setiap kegiatan tidak sah di bawah akun Anda atau pelanggaran keamanan lainnya. Kami tidak akan bertanggung jawab atas kerugian apa pun yang mungkin Anda alami akibat penggunaan atas akun atau kata sandi Anda, baik dengan atau tanpa sepengetahuan Anda, tanpa kesalahan atau kelalaian dari pihak kami.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kami akan mempertahankan informasi pribadi Anda dalam <em>database</em> kami sesuai dengan kebijakan dan hukum yang berlaku.  menggunakan pengamanan fisik, administrasi dan teknis untuk menunjang perlindungan kerahasiaan dan integritas informasi pribadi dan untuk menghindari penyalahgunaan, pengungkapan akses yang tidak sah atau mengganti informasi pribadi pengguna.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Jika informasi dikompromikan sebagai akibat dari pelanggaran keamanan, kami akan mengambil langkah-langkah yang wajar untuk menyelidiki situasi dan jika perlu, memberi tahu individu-individu yang informasinya mungkin telah disalahgunakan dan mengambil langkah-langkah lain sesuai dengan undang-undang atau peraturan yang berlaku.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<br />\r\n<strong>Perubahaan Kebijakan Privasi</strong><br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n dapat mengubah atau menambah Kebijakan Privasi ini dari waktu ke waktu. Setiap perubahan pada Kebijakan Privasi akan diumumkan pada situs kami. Perubahan kebijakan ini dilakukan untuk memperbaiki dan lebih menyempurnakan kebijakan-kebijakan sebelumnya.</p>\r\n\r\n<p>&nbsp;</p>'),
